import Login from './Compoment/Login_Registor/Login';
import Home from './Compoment/Home/Home';
import ApiDocument from './Compoment/Api'
import React from 'react'
import './asset/css/bootstrap.min.css';
import './App.css'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  useRouteMatch
} from "react-router-dom";
function App() {
  let {path,url}=useRouteMatch()
  return (
    <Router>
      <Switch>
        <Route exact={true} path="/login" render={() => <Login status_login={false}></Login>}></Route>
        <Route exact={true} path="/register" render={() => <Login status_login={true}></Login>}></Route>

        <Route exact path="/">
          <Switch>
            <Route path={path} component={Home}></Route>
            <Route path={`${path}/:topid`} render={() => <p>thongtin</p>}></Route>
          </Switch>
        </Route>
        <Route exact path="/document" component={ApiDocument}></Route>
        <Route path='*'>
          <p>404 not found</p>
        </Route>
      </Switch>
    </Router>
  );
}


export default App;
